        bottom: 'June 6, 2019    By Rickie Baroch'
    }
]

export const Item = ()=>{
    items.map((item,index)=>{
      return(
        <div className="img-item-header">
          <img src={item.img} alt="" />
          <span>{item.title}</span>
        </div>
      )
    })
